Lonely Planet Hong Kong is your passport to the most relevant, up-to-date advice on what to see and skip, and what hidden discoveries await you.

Cruise Victoria Harbour aboard the Star Ferry, ride on the Peak Tram for amazing views, or explore the Mong Kok markets; all with your trusted travel companion. Get to the heart of Hong Kong and begin your journey now!
